import React, { useEffect } from 'react';
const tracker = () => {
    useEffect(() => {
        document.title = 'Tracker';
    });
    return (
        <div>
            <h1>Tracker Page</h1>
            <p>Tracker</p>
        </div>
    );
};
export default tracker;
